import Paper from "@mui/material/Paper"
import Grid from "@mui/material/Grid"
import Container from "@mui/material/Container"
import Box from "@mui/material/Box"
import { MainCardsDiv } from "../mui_css/styledComponents"

const classMainDiv = {
  divMainPannel: {
    flexGrow: 1,
	margin: 20,
  },
  paper: {
    padding: 20,
	margin:10,
    textAlign: "center",
    backgroundColor: "#fafafa",
    color: "blue",
	width: '330px',
	height: '200px',
  },
  box:{
	margin: 20,
	backgroundColor: "#fafafa",
    color: "white",
	width: '400px',
	height: '300px',
  }
};

const MainPannel = () =>{
    return(
	<div style={classMainDiv.divMainPannel}>
        <Container maxWidth="xl">
			<Grid container spacing={2} justifyContent="center">
				<Box style={classMainDiv.box}>
					<Paper style={classMainDiv.paper}>xs</Paper>
				</Box>
			</Grid>			
        </Container>
	</div>
    )   
}
export default MainPannel;
